Most APIs in Mesos accept protobuf messages with a corresponding JSON field mapping. To support multiple versions of the API, we decoupled the versioned protobufs backing the API from the "internal" protobufs used by the Mesos code. For example, the protobufs for the v1 Scheduler API are located at: include/mesos/v1/scheduler/scheduler.proto package mesos.v1.scheduler;
option java_package = "org.apache.mesos.v1.scheduler";
option java_outer_classname = "Protos";
... The corresponding internal protobufs for the Scheduler API are located at: include/mesos/scheduler/scheduler.proto package mesos.scheduler;
option java_package = "org.apache.mesos.scheduler";
option java_outer_classname = "Protos";
... The users of the API send requests (and receive responses) based on the versioned protobufs. We implemented evolve / devolve converters that can convert protobufs from any supported version to the internal protobuf and vice versa. Internally, message passing between various Mesos components would use the internal unversioned protobufs. When sending response (if any) back to the user of the API, the unversioned protobuf would be converted back to a versioned protobuf.
